(ns advent-of-code-2018.day-05
  (:require [clojure.test :refer :all]
            [advent-of-code-2018.common :refer :all]
            [clojure.set :refer :all]
            [clojure.string :refer [split-lines includes? upper-case lower-case]]))

(def test-input "dabAcCaCBAcCcaDA")
(def input "")

(defn cut
  {:test (fn []
           (is (= (cut "abc" "b") "ac"))
           )}
  [str remove-pat]
  (clojure.string/replace str (re-pattern remove-pat) ""))

(defn char-range [start end]
  (map char (range (int start) (inc (int end)))))

(defn will-react?
  {:test (fn []
           (is (will-react? "a" "A"))
           (is (will-react? "A" "a"))
           (is (not (will-react? "a" "a")))
           (is (not (will-react? "A" "A"))))}
  [s1 s2]
  (and (= (lower-case s1) (lower-case s2))
       (not (= s1 s2))))

(defn destroy-once
  {:test (fn []
           (is (= (destroy-once test-input) "dabAaCBAcaDA")))}
  [polymer]
  (reduce (fn [result [s1 s2]]
            (if (will-react? s1 s2)
              (cut result (str s1 s2))
              result))
          polymer
          (set (partition 2 1 polymer))))

(defn destroy-all
  {:test (fn []
           (is (= (destroy-all test-input) "dabCBAcaDA"))
           (is (= (count (destroy-all test-input)) 10))
           (is (= (count (destroy-all input)) 10804)))}      ; part 1
  [polymer]
  (loop [current-polymer polymer
         prev-polymer (destroy-once polymer)]
    (if (= current-polymer prev-polymer)
      current-polymer
      (recur (destroy-once current-polymer) current-polymer))))

(defn remove-most-blocking-and-destroy
  {:test (fn []
           (is (= (remove-most-blocking-and-destroy test-input) 4))
           (comment (is (= (remove-most-blocking-and-destroy input) 6650))))} ; part 2
  [polymer]
  (->> (char-range \a \z)
       (pmap (fn [char]
              (-> polymer
                  (cut (upper-case (str char)))
                  (cut (lower-case (str char)))
                  (destroy-all)
                  (count))))
       (apply min)))

